import { Component } from '@angular/core';
import { Gestor } from '../gestor';

@Component({
  selector: 'app-lista-gestores',
  templateUrl: './lista-gestores.component.html',
  styleUrls: ['./lista-gestores.component.css']
})
export class ListaGestoresComponent implements OnInit {

  gestores:Gestor[];


  constructor (private gestorServicio:ClienteService) { }

  ngOnInit():void {
    this.obtenerClientes();
  }

  private obtenerClientes() {
    this.clienteServicio.obtenerListaDeClientes().subscribe(dato => {
      this.clientes = dato;
    });
  }
}
